import { Component } from '@angular/core';
import { UnityService } from '../unity.service';
import { ParameterChangeRequest } from '../ParameterChangeRequest';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  speed:number = 2;
  objectsAmount:number = 30;
  timeInSeconds:number = 60;
  response?:string;

  constructor(private unityService:UnityService){
    this.testConnection()
  }

  async testConnection(){
    (await this.unityService.testConnection()).subscribe(value => console.log(value.message));
  }

  async applyAmountOfSeconds() {
    let parameterChangeRequest:ParameterChangeRequest = {
      script: "objectSpawner",
      parameter: "timeInSeconds",
      value: this.timeInSeconds
    };

    (await this.unityService.sendToUnity(parameterChangeRequest)).subscribe(value => this.response = value.message);
  }

  async applyAmountOfObjects() {
    let parameterChangeRequest:ParameterChangeRequest = {
      script: "objectSpawner",
      parameter: "amountOfObjects",
      value: this.objectsAmount
    };

    (await this.unityService.sendToUnity(parameterChangeRequest)).subscribe(value => this.response = value.message);
  }

  async applySpeed() {
    let parameterChangeRequest:ParameterChangeRequest = {
      script: "touchObject",
      parameter: "speed",
      value: this.speed
    };

    (await this.unityService.sendToUnity(parameterChangeRequest)).subscribe(value => this.response = value.message);
  }
}
<div class="columns">
  <div class="column is-two-fifths">
    <div class="box mt-5">
      <label class="label">Object speed</label>
      <input
        type="range"
        min="1"
        max="15"
        value="2"
        class="slider"
        id="myRange"
        [(ngModel)]="speed"
      />

      <div class="control pl-3">
        <input class="input" type="number" [(ngModel)]="speed" />
      </div>

      <button class="button" onclick="applySpeed()">Apply</button>
    </div>

    <div class="box mt-5">
      <label class="label"
        >Amount of objects patient has to dodge in the given time</label
      >
      <input
        type="range"
        min="1"
        max="500"
        value="30"
        class="slider"
        id="myRange"
        [(ngModel)]="objectsAmount"
      />

      <div class="control pl-3">
        <input class="input" type="number" [(ngModel)]="objectsAmount" />
      </div>

      <button class="button" onclick="applyAmountOfObjects()">Apply</button>
    </div>

    <div class="box mt-5">
      <label class="label">Length of the level in seconds</label>
      <input
        type="range"
        min="1"
        max="600"
        value="60"
        class="slider"
        id="myRange"
        [(ngModel)]="timeInSeconds"
      />

      <div class="control pl-3">
        <input class="input" type="number" [(ngModel)]="timeInSeconds" />
      </div>

      <button class="button" onclick="applyAmountOfSeconds()">Apply</button>
    </div>
  </div>

  <div class="column"></div>
</div>
